(913, 'https://accounts.google.com/SignUp?continue=https%3A%2F%2Fplus.google.com%2F110579255915399754170', '  Create your Google Account  ', 'A single username and password gets you into everything Google (Gmail, Chrome, YouTube, Google Maps). Set up your profile and preferences just the way you like. Switch between devices, and pick up wherever you left off.', '', 0),
(914, 'http://www.timeshighereducation.co.uk/rankings/impact/2019/overall', 'University Impact Rankings 2019 | Times Higher Education (THE)', 'The Times Higher Education University Impact Rankings are the only global performance tables that assess universities against the United Nations’ Sustainable Development Goals. We use carefully calibrated indicators to provide comprehensive and balanced comparisons across three broad areas: research, outreach, and stewardship. This first edition includes more than 450', '', 0),
