(1278, 'http://www.timeshighereducation.co.uk/student/what-to-study/accounting-finance', 'Top universities where you can study Accounting & Finance | Times Higher Education (THE)', 'An accountant is responsible for the management and analysis of transactions and capital holdings – the world of business essentially rests on their shoulders. To study accountancy you need to demonstrate attention to detail, an excellent grasp on numbers and strong organisational skills. It should be noted that dedication to pursue the profession is required, as is the', '', 0),
(1279, 'https://twitter.com/privacy', 'Privacy Policy', '', '', 0),
(1280, 'http://www.timeshighereducation.co.uk/student/what-to-study/business-management', 'Top universities where you can study Business & Management | Times Higher Education (THE)', 'Do you see yourself as the CEO of a Fortune 500 company? Do you have an amazing idea you want to grow into a global business? If so a degree in business and management is the perfect place to start. Business and management is a consistently popular choice among students and most universities and colleges teach the subject in some form. Courses cover a wide array of', '', 0),
