(1282, 'https://business.twitter.com/en/help/troubleshooting/how-twitter-ads-work.html', 'How Twitter Ads work', 'Learn how and why users are paired with the ads they see and how to adjust privacy settings to change the information Twitter receives about an account.', '', 0),
(1283, 'http://www.timeshighereducation.co.uk/student/what-to-study/economics-econometrics', 'Top universities where you can study Economics & Econometrics | Times Higher Education (THE)', 'Economists fit within the social sciences group of disciplines and examine the full spectrum of issues that impact on financial situations and decisions. Subjects of study range from production to consumption and economics scrutinises how the world’s resources are utilised and distributed among individuals and organisations. In order to do so, economists study strands of', '', 0),
