(1286, 'http://support.twitter.com/articles/14226-how-to-find-your-twitter-short-code-or-long-code', 'How to Tweet via text message', 'Get an overview on how to Tweet via text message from your mobile device.', 'twitter text, twitter sms, text to tweet ', 0),
(1287, 'http://www.timeshighereducation.co.uk/student/what-to-study/agriculture-forestry', 'Top universities where you can study Agriculture & Forestry | Times Higher Education (THE)', 'An agriculture or forestry degree will enable you to understand more about the theoretical study and practical application of farming. Studying a degree in agriculture and forestry can lead to the understanding of real life problems and the ability to resolve them. There are ongoing developments in this area of study which could help lead to the eradication of food poverty and', '', 0),
(1288, 'http://www.timeshighereducation.co.uk/news/career-advice-how-write-cv-university-job', 'Career advice: how to write a CV for a university job | THE News', 'Keep it brief, tailor to the job requirements and do not mention your hobbies. Our panel of top university administrators offer some tips on how to write a top-notch CV', '', 0),
(1289, 'http://www.timeshighereducation.co.uk/student/what-to-study/biological-sciences', 'Top universities where you can study Biological Sciences | Times Higher Education (THE)', 'Biological sciences is the study of life and living organisms, their life cycles, adaptations and environment. There are many different areas of study under the umbrella of biological sciences including biochemistry, microbiology and evolutionary biology. A course in biological sciences will combine practical and theory work with a mixture of lectures, seminars and lab work.', '', 0),
(1290, 'http://www.timeshighereducation.co.uk/blog/ten-tips-applying-postdoc-fellowship', 'Ten tips on applying for a postdoc fellowship | Times Higher Education (THE)', 'Competition for postdoctoral fellowships is fierce, so your application needs to stand out as realistic, coherent and compelling. Here, five Stanford University scientists reveal 10 tips from their own experiences when attempting to secure a place', '', 0),
(1291, 'http://www.timeshighereducation.co.uk/student/what-to-study/sport-science', 'Top universities where you can study Sport Science | Times Higher Education (THE)', 'Sport science is the study of how the healthy human body works during exercise, and how sport and physical activity promotes health – physically, mentally and socially. The study of sport science calls upon and uses many other academic studies and areas, like physiology, psychology, engineering, chemistry and anatomy. It is a relatively new subject and has gained popularity in', '', 0),
(1292, 'http://www.timeshighereducation.co.uk/author/li-ma', 'Li Ma | Times Higher Education (THE)', '', '', 0),
(1293, 'http://www.timeshighereducation.co.uk/student/what-to-study/veterinary-science', 'Top universities where you can study Veterinary Science | Times Higher Education (THE)', 'Veterinary science deals with the health and wellbeing of animals. Much like a medical degree, it covers everything from preventative care to psychological assessment to complex surgical procedures. In order to become a qualified practitioner, students should anticipate a relatively long and demanding period of study (an average of five years) and once established within the', '', 0),
(1294, 'http://www.timeshighereducation.co.uk/opinion/cvs-failure-academia-do-not-tell-whole-story', 'CVs of failure in academia do not tell the whole story | THE Comment', 'Being open about failure is one thing, but we must also look at how we define success, says Shahidha Bari', '', 0),
(1295, 'http://www.timeshighereducation.co.uk/student/what-to-study/archaeology', 'Top universities where you can study Archaeology | Times Higher Education (THE)', 'If you’re enthralled by human evolution and biology, ancient culture and language, the emergence of the early civilisations, or how humans interact with our heritage and environment, a degree in archaeology may be ideal. Archaeology courses span across both the humanities and social sciences, examining human history over millions of years. This is achieved through a', '', 0),
(1296, 'http://www.timeshighereducation.co.uk/content/shahidha-bari', 'Shahidha Bari | Times Higher Education (THE)', '', '', 0),
(1297, 'https://www.timeshighereducation.com/unijobs/listings/china/', 'Jobs in China', 'Exciting new opportunities in China', 'China, Jobs, Europe, Academic, University, Professor, Lecturer, Director, Heads, Department', 0),
(1298, 'http://www.timeshighereducation.co.uk/student/what-to-study/architecture', 'Top universities where you can study Architecture | Times Higher Education (THE)', 'Architecture is the art and science of designing and engineering buildings and large structures. It is an architect’s responsibility to design structures fit for use by humans, therefore it also rests on them to ensure buildings are safe and reliable – which is why students face a long period of study before becoming a licensed architect. It usually takes five years of study', '', 0),
