(1300, 'http://www.timeshighereducation.co.uk/policy/interviews', 'Interviews | Times Higher Education (THE)', 'Careers related tag', '', 0),
(1301, 'http://www.timeshighereducation.co.uk/student/what-to-study/art-performing-arts-design', 'Top universities where you can study Art, Performing Arts & Design | Times Higher Education (THE)', 'Performing arts degrees mix the nurturing of creative talent with practical aspects of arts management and self-promotion, which is excellent preparation for entering the world of performance. A performing arts degree can be practise-based, with a large amount of actual performing, or academic, combining practical work with background analysis. Teaching is done through a blend', '', 0),
