(1303, 'http://www.timeshighereducation.co.uk/student/what-to-study/history-philosophy-theology', 'Top universities where you can study History, Philosophy & Theology | Times Higher Education (THE)', 'Described as one of the oldest academic disciplines, philosophy challenges the assumptions which uphold other subject areas – including the sciences, social sciences, religion and arts. Students must grapple with the nature of existence, the meaning of good and evil, whether knowledge is possible and whether any human is truly free. Teaching will cover ancient to contemporary', '', 0),
