(1305, 'http://www.timeshighereducation.co.uk/student/what-to-study/languages-literature-linguistics', 'Top universities where you can study Languages, Literature & Linguistics | Times Higher Education (THE)', 'An English literature degree will incorporate elements of history, sociology, philosophy, critical thinking, visual culture and more, teaching students to place works in their proper context and providing an understanding of how societies create art and how ideas in great works of writing can create profound changes in society. Most degrees also include an element of critical', '', 0),
(1306, 'http://www.timeshighereducation.co.uk/student/what-to-study/chemical-engineering', 'Top universities where you can study Chemical Engineering | Times Higher Education (THE)', 'Chemical engineers design and produce the processes to produce, transform and transport materials to become usable and useful end products – from plastics, to pharmaceuticals to make-up. This begins with experiments in a laboratory and follows on to implementing the technologies in full-scale production. A degree in chemical engineering combines chemistry, physics, biology,', '', 0),
(1307, 'http://www.timeshighereducation.co.uk/student/what-to-study/civil-engineering', 'Top universities where you can study Civil Engineering | Times Higher Education (THE)', 'Civil engineering is the practice of designing and developing infrastructure objects, on a large scale, developing nationwide transport systems or water supply networks, or on a more minor scale, developing roads and buildings, for example. A civil engineer is responsible for all aspects of building structures – comprising the planning, design, budgeting, construction', '', 0),
(1308, 'http://www.timeshighereducation.co.uk/student/what-to-study/electrical-electronic-engineering', 'Top universities where you can study Electrical & Electronic Engineering | Times Higher Education (THE)', 'To begin with, it is important to distinguish the difference between electric and electronic engineering. Electric engineering covers the large-scale production and distribution of electrical power, whereas electronic engineering is about much smaller electronic circuits, such as those found in computers and other modern technologies. This is why electronic engineering is', '', 0),
(1309, 'http://www.timeshighereducation.co.uk/student/what-to-study/general-engineering', 'Top universities where you can study General Engineering | Times Higher Education (THE)', 'General engineering is the branch of science and technology that deals with the design, building, maintenance and use of engines, machines and structures. It includes subcategories like electrical, chemical, mechanical, civil, architectural engineering and computer engineering. It is an engineer’s responsibility to find solutions to problems facing both developing and', '', 0),
(1310, 'http://championtsd.com/make-payment.php', 'Make a Payment | Champion Tang Soo Do', '', '', 0),
(1311, 'http://www.timeshighereducation.co.uk/student/what-to-study/mechanical-aerospace-engineering', 'Top universities where you can study Mechanical & Aerospace Engineering | Times Higher Education (THE)', 'Mechanical engineering is the study of maintaining, analysing, designing and manufacturing machinery. This ranges from designing the tiny parts of machines, as well as the handling of large-scale machinery. There is often overlap with aerospace engineering, or the chance to study it as a joint honours degree. Aerospace engineering is the design, construction and maintenance of', '', 0),
