(1325, 'http://www.timeshighereducation.co.uk/features/stefano-bloch-life-and-death-las-graffiti-subculture', 'Stefano Bloch: life and death in LA’s graffiti subculture | Times Higher Education (THE)', 'During his time as a graffiti writer, Stefano Bloch was chased by the police, threatened by gangsters and witnessed savage violence. He tells Jack Grove about how he has incorporated such experiences in a powerful memoir that also makes an important contribution to research on urban life', '', 0),
