(1555, 'http://www.timeshighereducation.co.uk/student/what-to-study/geography', 'Top universities where you can study Geography | Times Higher Education (THE)', 'Geography is the study of the world around us, and the impact of natural and manmade factors and events on the world. A degree in this subject is either in human geography (focusing on human societies and the relationship between people and the planet) or physical geography (focusing on natural environments and physical processes). The latter is closely linked with earth', '', 0),
