(1560, 'http://www.timeshighereducation.co.uk/student/what-to-study/politics-international-studies-incl-development-studies', 'Top universities where you can study Politics & International Studies (incl Development Studies) | Times Higher Education (THE)', 'Politics is the study of how governments function, how public policies are made, international relations and political ideas, ranging from democracy to human rights. Any politics degree will include the examination of current and past political conflict around the world; different models and mechanisms of government; ideologies such as communism, anarchism and liberalism; and', '', 0),
