(1563, 'http://www.timeshighereducation.co.uk/student/what-to-study/sociology', 'Top universities where you can study Sociology | Times Higher Education (THE)', 'Sociologists study the structures of our societies and how individuals are affected by them. Sociology looks at how these structures came to be and how individuals interact with them. Subjects of study can range from criminal gangs to religious organisations, race, class and gender to the makeup of the family unit or the state. As an academic subject, sociology seeks to', '', 0),
