(1566, 'http://www.timeshighereducation.co.uk/student/what-to-study/computer-science', 'Top universities where you can study Computer Science | Times Higher Education (THE)', 'A degree in computer science is essentially the study of information and computation, using a scientific and practical approach. Any type of calculation or use of computing technology is defined as computation. Computer science degrees cover the technology involved in well-defined models, like algorithms and protocols, to aid the acquisition, representation, processing,', '', 0),
