(1568, 'http://www.timeshighereducation.co.uk/student/what-to-study/education', 'Top universities where you can study Education | Times Higher Education (THE)', 'Do you want to inspire the next generation? If so a degree in education is your first step to a rewarding career in teaching. Most university level education courses prepare students for a number of roles in primary, secondary and college-level education. Most courses will combine theory and practice and will include at least one placement in a school. The theoretical elements', '', 0),
