(1602, 'http://www.timeshighereducation.co.uk/features/what-low-quality-course', 'What is a ‘low-quality’ course? | Times Higher Education (THE)', 'The UK government is determined to make good on its manifesto pledge to crack down on substandard university programmes. But what is quality? Is it best measured by graduate earnings, learning gain, a national university curriculum – or something else entirely? Anna McKie ponders the options ', '', 0),
(1603, 'http://www.timeshighereducation.co.uk/features/will-coronavirus-make-online-education-go-viral', 'Will the coronavirus make online education go viral? | Times Higher Education (THE)', 'The sudden closure of university campuses across China and elsewhere has necessitated the virtual delivery of vast numbers of courses. And while there have been inevitable teething problems, observers are wondering whether the future might just have become the present. Joyce Lau reports', '', 0),
(1604, 'http://www.timeshighereducation.co.uk/student/where-to-study/study-in-bulgaria', 'Study in Bulgaria | Times Higher Education (THE)', '', '', 0),
(1605, 'http://www.timeshighereducation.co.uk/student/where-to-study/study-in-canada', 'Study in Canada | Times Higher Education (THE)', 'Canada is very popular destination for students looking to gain a degree overseas, thanks to its many respected universities and its reputation as a safe and welcoming country. With consistently high levels of education spending, it boasts almost uniformly high standards of higher education, with several institutions regularly featuring among the top 100 globally. These', '', 0),
(1606, 'http://www.timeshighereducation.co.uk/student/where-to-study/study-in-chile', 'Study in Chile | Times Higher Education (THE)', 'Chile’s illustrious list of natural sights includes some of the finest on the planet, and the country has begun to establish itself as a study destination too. Chile’s universities, many of which are located in Santiago, the capital city, arguably include two of the most prestigious in the whole continent: the University of Chile and the Pontifical Catholic University of', '', 0),
(1607, 'http://www.timeshighereducation.co.uk/news/minister-warns-against-uk-over-reliance-chinese-students', 'Minister warns against UK over-reliance on Chinese students | Times Higher Education (THE)', 'Chris Skidmore says UK must increase diversity of its international intake', '', 0),
(1608, 'http://www.timeshighereducation.co.uk/news/rude-peer-reviews-inflict-most-damage-women-and-minorities', '‘Rude’ peer reviews inflict most damage on women and minorities | Times Higher Education (THE)', 'Study says comments such as ‘she should be in the kitchen, not writing papers’ affect the careers of under-represented groups', '', 0),
