(1615, 'https://www.the-awards.co.uk/2020/en/page/home-awards', 'THE Awards 2020', 'The THE Awards are widely recognised as the Oscars of the higher education sector. Each year we attract hundreds of entries that exemplify the talent, dedication and innovation of individuals and teams across all aspects of university life, showing us countless reasons why our institutions prosper.', 'awards,uk,higher education', 0),
