(1633, 'https://www.timeshighereducation.com/events/forums', 'THE Global Forums | Times Higher Education (THE)', 'Our series of focused forums bring together senior leaders across higher education, research, industry and policymaking, to share data and best practice and innovative ideas about the future of universities.', '', 0),
(1634, 'https://www.timeshighereducation.com/events/symposiums', 'THE Symposiums | Times Higher Education (THE)', '', '', 0),
