(1636, 'https://www.timeshighereducation.com/world-university-rankings', 'World University Rankings | Times Higher Education (THE)', 'The Times Higher Education World University Rankings, founded in 2004, is a vital resource that provides the definitive list of the world\'s best universities.', '', 0),
(1637, 'https://www.timeshighereducation.com/rankings/japan-university/2020', 'Japan University Rankings 2020 | Times Higher Education (THE)', 'The Times Higher Education Japan University Rankings 2020 are designed to answer the questions that matter most to students and their families when making one of the most important decisions of their lives – who to trust with their education. This year’s methodology includes the same 16 performance indicators as last year, with three of the metrics drawing on the THE Japan', '', 0),
(1638, 'https://www.timeshighereducation.com/world-university-rankings/2020/world-ranking', 'World University Rankings 2020 | Times Higher Education (THE)', 'The Times Higher Education World University Rankings 2020 includes almost 1,400 universities across 92 countries, standing as the largest and most diverse university rankings ever to date. The table is based on 13 carefully calibrated performance indicators that measure an institution’s performance across teaching, research, knowledge transfer and international outlook. The', '', 0),
(1639, 'https://www.timeshighereducation.com/rankings/europe-teaching/2019', 'Europe Teaching Rankings 2019 | Times Higher Education (THE)', 'The Europe Teaching Rankings is part of Times Higher Education’s series of tables focusing on higher education institutions’ teaching and learning environments for students. The results are heavily drawn from the THE European Student Survey, that this year received responses from 125,000 students across 18 countries. As well as student engagement, the ranking measures student', '', 0),
(1640, 'https://www.timeshighereducation.com/rankings/impact/2019/overall', 'University Impact Rankings 2019 | Times Higher Education (THE)', 'The Times Higher Education University Impact Rankings are the only global performance tables that assess universities against the United Nations’ Sustainable Development Goals. We use carefully calibrated indicators to provide comprehensive and balanced comparisons across three broad areas: research, outreach, and stewardship. This first edition includes more than 450', '', 0),
(1641, 'https://www.timeshighereducation.com/rankings/united-states/2020', 'Wall Street Journal/Times Higher Education College Rankings 2020 | Times Higher Education (THE)', 'The Wall Street Journal/Times Higher Education College Rankings gives students and their families the information that they need to help them choose where to study. The ranking of more than 800 universities is based on 15 individual performance indicators and responses from more than 170,000 current college students, collected through THE’s annual US Student Survey.', '', 0),
(1642, 'https://www.timeshighereducation.com/world-university-rankings/by-subject', 'World University Rankings by Subject | Times Higher Education', 'Search the Times Higher Education World University Rankings by subject, refining your search by rankings only, performance breakdown or key statistics.', '', 0),
(1643, 'https://www.timeshighereducation.com/policy/rankings', 'Rankings | Times Higher Education (THE)', 'Discover the latest news, features, comment and reviews on the policy and thinking behind the Times Higher Education World University Rankings 2015-2016.', '', 0),
(1644, 'https://www.timeshighereducation.com/world-university-rankings/about-the-times-higher-education-world-university-rankings', 'About the Times Higher Education World University Rankings | THE Books', 'Everything you need to know about Times Higher Education’s global portfolio of university rankings', '', 0),
(1645, 'http://www.timeshighereducation.co.uk/student/where-to-study/study-in-china', 'Study in China | Times Higher Education (THE)', 'China’s rapid growth as a global economic power has coincided with its universities’ exponential growth, one of the stories of higher education since the start of the new millennium. The number of overseas students in China has multiplied over the past few decades, and the number of degree programmes and investment in higher education has increased substantially.', '', 0),
(1646, 'http://www.timeshighereducation.co.uk/student/where-to-study/study-in-colombia', 'Study in Colombia | Times Higher Education (THE)', 'Colombia is South America’s second most populous country after Brazil, and its economy is growing. More than 40 of its universities have featured in Latin America rankings. Its most decorated higher education institution is arguably the University of the Andes in Bogotá, the capital, but the National University of Colombia, the University of Antioquia, based mainly in', '', 0),
(1647, 'http://www.timeshighereducation.co.uk/student/where-to-study/study-in-costa-rica', 'Study in Costa Rica | Times Higher Education (THE)', '', '', 0),
(1648, 'http://www.timeshighereducation.co.uk/student/where-to-study/study-in-croatia', 'Study in Croatia | Times Higher Education (THE)', '', '', 0),
(1649, 'http://www.timeshighereducation.co.uk/student/where-to-study/study-in-cuba', 'Study in Cuba | Times Higher Education (THE)', '', '', 0),
(1650, 'http://www.timeshighereducation.co.uk/student/where-to-study/study-in-cyprus', 'Study in Cyprus | Times Higher Education (THE)', 'Europe’s southernmost country, Cyprus is beautiful, sunny and well-known for its long summers and sandy beaches. The former British colony, Cyprus retains something of an English feel, with all its universities offering courses in English. Its higher education sector attracts around 10,000 international students, with institutions charging fairly modest tuition fees. Public', '', 0),
(1651, 'https://www.timeshighereducation.com/student', 'Welcome to THE Student | Times Higher Education (THE)', 'Welcome to THE Student; search for a university, read the international higher education news, or find the answer to your questions with our featured advice.', '', 0),
(1652, 'http://www.timeshighereducation.co.uk/student/where-to-study/study-in-czech-republic', 'Study in The Czech Republic | Times Higher Education (THE)', 'The landlocked nation of the Czech Republic, also known as Czechia, is picturesque country in central Europe. As well as its renowned universities, located across the nation and providing exceptional educational opportunities, a steady influx of young tourists from across the European continent and beyond sustains the country’s vibrant reputation as a lively, youthful', '', 0),
(1653, 'https://www.timeshighereducation.com/student/best-universities', 'Best universities | Times Higher Education (THE)', '', '', 0),
(1654, 'https://www.timeshighereducation.com/student/where-to-study', 'Where to study: which university is right for you?', 'Choosing where to study, and to which university you should go, is one of the most important decisions you will make. There are many things to consider. First of all, which country/region should you study in? And what are the top universities in that country/region? Times Higher Education’s World University Rankings assess universities across all of their core missions,', '', 0),
