(1670, 'http://www.timeshighereducation.co.uk/student/where-to-study/study-in-finland', 'Study in Finland | Times Higher Education (THE)', 'Stunning Nordic scenery makes Finland a very desirable country to study in. The beautiful landscape means that it’s a perfect destination for those who love being outdoors, with skiing, fishing and water sports among Finland’s most popular pastimes. Its climate offers midnight sun in the summer, as well as polar winters, and the opportunity to see the aurora borealis (Northern', '', 0),
(1671, 'http://www.timeshighereducation.co.uk/student/where-to-study/study-in-france', 'Study in France | Times Higher Education (THE)', 'France really does have a little bit of everything. A unique cuisine, a rich and diverse culture, fascinating history and architecture as well as stunning scenery - all of these features help to make up one of the world’s most popular countries in which to study. The chic capital Paris is a place of grandeur and opulence, with world-famous landmarks dotted throughout the city:', '', 0),
