(1676, 'http://www.timeshighereducation.co.uk/student/what-to-study/other-health', 'Top universities where you can study Other Health | Times Higher Education (THE)', 'Becoming a midwife or a nurse is a similar process for both. To work as either, you will need to be registered with the Nursing and Midwifery Council (NMC), which requires a degree in your chosen subject from an institution approved by the NMC. With no previous nursing experience, a midwifery degree will take three years and covers biological sciences, applied sociology,', '', 0),
(1677, 'http://www.timeshighereducation.co.uk/student/what-to-study/psychology', 'Top universities where you can study Psychology | Times Higher Education (THE)', 'Psychology is the study of human behaviour, thoughts, actions, interactions and reactions and a psychology student will demonstrate this through essays and experiments. The basis of most psychology degrees is in natural and life sciences, however there is the opportunity to investigate social sciences and humanities too, for example in criminology and philosophy. Psychology', '', 0),
(1678, 'http://www.timeshighereducation.co.uk/student/where-to-study/study-in-ghana', 'Study in Ghana | Times Higher Education (THE)', 'Since becoming the first sub-Saharan African nation to gain independence, Ghana has gone from strength to strength and today stands as one of the most developed nations in west Africa. Ghana has been able to develop its economy and infrastructure while preserving its rich and diverse variety of cultures. If you travel from its beautiful beaches, spread along the coast, to', '', 0),
