(9324, 'https://es-la.facebook.com/login/?next=https%3A%2F%2Fwww.facebook.com%2Fpages%2FMark-Zuckerberg%2F112845672063384', 'Iniciar sesión en Facebook | Facebook', 'Inicia sesión en Facebook para empezar a compartir y conectarte con tus amigos, tus familiares y las personas que conoces.', '', 0),
(9325, 'https://fr-fr.facebook.com/login/?next=https%3A%2F%2Fwww.facebook.com%2Fpages%2FMark-Zuckerberg%2F112845672063384', 'Se connecter à Facebook | Facebook', 'Connectez-vous à Facebook pour commencer à partager et communiquer avec vos amis, votre famille et les personnes que vous connaissez.', '', 0),
(9326, 'https://zh-cn.facebook.com/login/?next=https%3A%2F%2Fwww.facebook.com%2Fpages%2FMark-Zuckerberg%2F112845672063384', '登录 Facebook | Facebook', '登录 Facebook，与好友、家人和认识的人分享和建立联系。', '', 0),
(9327, 'https://ar-ar.facebook.com/login/?next=https%3A%2F%2Fwww.facebook.com%2Fpages%2FMark-Zuckerberg%2F112845672063384', 'تسجيل الدخول إلى فيسبوك | فيسبوك', 'قم بتسجيل الدخول إلى فيسبوك لبدء المشاركة والتواصل مع أصدقائك وعائلتك والأشخاص الذين تعرفهم.', '', 0),
(9328, 'https://pt-br.facebook.com/login/?next=https%3A%2F%2Fwww.facebook.com%2Fpages%2FMark-Zuckerberg%2F112845672063384', 'Entrar no Facebook | Facebook', 'Entre no Facebook para começar a compartilhar e se conectar com seus amigos, familiares e com as pessoas que você conhece.', '', 0),
(9329, 'https://it-it.facebook.com/login/?next=https%3A%2F%2Fwww.facebook.com%2Fpages%2FMark-Zuckerberg%2F112845672063384', 'Accedi a Facebook | Facebook', 'Accedi a Facebook per iniziare a condividere contenuti e connetterti con i tuoi amici, la famiglia e le persone che conosci.', '', 0),
(9330, 'https://ko-kr.facebook.com/login/?next=https%3A%2F%2Fwww.facebook.com%2Fpages%2FMark-Zuckerberg%2F112845672063384', 'Facebook에 로그인 | Facebook', 'Facebook에 로그인하세요. 친구, 가족, 지인들과 함께 하는 즐거운 Facebook 생활이 시작됩니다.', '', 0),
(9331, 'https://de-de.facebook.com/login/?next=https%3A%2F%2Fwww.facebook.com%2Fpages%2FMark-Zuckerberg%2F112845672063384', 'Bei Facebook anmelden | Facebook', 'Melde dich bei Facebook an, um dich mit deinen Freunden, deiner Familie und Personen, die du kennst, zu verbinden und Inhalte zu teilen.', '', 0),
(9332, 'https://hi-in.facebook.com/login/?next=https%3A%2F%2Fwww.facebook.com%2Fpages%2FMark-Zuckerberg%2F112845672063384', 'Facebook में लॉग इन करें | Facebook', 'अपने मित्रों, परिवार और अपने परिचित लोगों से साझा करना और कनेक्ट करना शुरू करने के लिए Facebook में लॉग इन करें.', '', 0),
